# 获取简历内容
def get_document(filepath):
    z = zipfile.ZipFile(filepath, "r")
    text = z.read("word/document.xml").decode("UTF-8")
    text = re.sub(r"<.*?>", "", text)  # 去除xml里的所有标记符
    return text


# 解析简历
# 由于简历非标准结构只能采取才常规解析
def resolveResume(filename=os.getcwd()+"/tools/宋围成-2年-python .docx"):
    fileText = get_document(filename)
    resume = {}
    resume["livein"] = ""
    resume["workPosition"] = ""
    resume["workPosition2"] = ""
    resume["firm"] = ""
    resume["trade"] = ""
    resume["specialty"] = ""
    resume["school"] = ""
    resume["education"] = ""
    resume["account"] = ""
    resume["weddingstatus"] = ""
    resume["income"] = ""
    resume["persionlaber"] = ""
    resume["hopesalary"] = ""
    resume["location"] = ""
    resume["office"] = ""
    resume["totime"] = ""
    resume["jobtype"] = ""
    resume["selfassess"] = ""
    resume["empiric"] = []
    resume["project_empiric"] = []
    resume["edu_empiric"] = ""
    empiric = ""
    project_empiric = ""
    for i, text in enumerate(fileText.split("|")):
        if i == 0:
            # 名称
            resume["name"] = text.split("ID:")[0].strip()
            # id
            resume["id"] = "".join(map(str, [i for i in re.findall("ID:(\d+)", text)]))
            # resume['state'] = re.findall()
            # 电话
            resume["phone"] = "".join(map(str, [i for i in re.findall("(\d{11})", text)]))
            # 性别
            resume['sex'] = text[-1]
            # 为了获取状态与邮件
            subString = text.replace(resume["name"], "").replace(resume["id"], "").replace(resume["sex"], "").replace(
                "ID:", "").strip()
            # 状态，邮件
            resume["state"], resume["email"] = subString.split(resume["phone"])[:]
        elif i == 1:
            resume["age"], resume["birthday"] = text.split("(")[0].strip(), re.findall("[(](.*?)[)]", text)[0]
        elif i == 2:
            resume["livein"] = re.findall("现居住(.+)", text.strip())[0]
        else:
            if "工作经验" in text:
                resume["workTime"] = text.split("工作经验")[0] + "工作经验"
            if not resume["workPosition"]:
                resume["workPosition"] = re.findall(r"工作职位：(.*?)公司", text)[0].strip()
            if not resume["firm"]:
                resume["firm"] = re.findall(r"公司：(.*?)行业", text)[0].strip()
            if not resume["trade"]:
                resume["trade"] = re.findall(r"行业：(.*?)最高学历", text)[0].strip()
            if not resume["specialty"]:
                resume["specialty"] = re.findall(r"专业：(.*?)学校", text)[0].strip()
            if not resume["school"]:
                resume["school"] = re.findall(r"学校：(.*?)学历", text)[0].strip()
            if not resume["education"]:
                resume["education"] = re.findall(r"学位：(.*?)个人信息户口", text)[0].strip()
            if not resume["account"]:
                resume["account"] = re.findall(r"国籍：(.*?)婚姻", text)[0].strip()
            if not resume["weddingstatus"]:
                resume["weddingstatus"] = re.findall(r"婚姻状况：(.*?)目前年收入", text)[0].strip()
            if not resume["income"]:
                resume["income"] = re.findall(r"目前年收入(.*?)求职意向", text)[0].strip()
            if not resume["persionlaber"]:
                resume["persionlaber"] = re.findall(r"个人标签：(.*?)期望薪资", text)[0].strip()
            if not resume["hopesalary"]:
                resume["hopesalary"] = re.findall(r"期望薪资：(.*?)地点", text)[0].strip()
            if not resume["location"]:
                resume["location"] = re.findall(r"地点：(.*?)职能", text)[0].strip()
            if not resume["office"]:
                resume["office"] = re.findall(r"职能/职位：(.*?)行业", text)[0].strip()
            if not resume["workPosition2"]:
                resume["workPosition2"] = re.findall(r"工程师 行业：(.*?)到岗时间", text)[0].strip()
            if not resume["totime"]:
                resume["totime"] = re.findall(r"到岗时间：(.*?)工作类型", text)[0].strip()
            if not resume["jobtype"]:
                resume["jobtype"] = re.findall(r"工作类型：(.*?)自我评价", text)[0].strip()
            if not resume["selfassess"]:
                resume["selfassess"] = re.findall(r"自我评价：(.*?)工作经验", text)[0].strip()
            if i == 3:
                empiric = "".join(text.replace(resume["workTime"], "").split("工作经验")[1].strip())
            elif i < 9:
                empiric += "".join(text.strip())
            elif i == 9:
                empiric += "".join(text.split("项目经验")[0].strip())
                project_empiric += "".join(text.split("项目经验")[1].strip().split("教育经历")[0].split())
                resume["edu_empiric"] = text.split("教育经历")[1].strip()
            else:
                resume["edu_empiric"] += "".join(map(str, [rt for rt in text.split("技能特长")[0]]))
                resume["skill"] = text.split("技能/语言")[1]
    group = re.findall("(\d{4}/\d-)", empiric)
    # 自己知道只有两个所以没写多个的判断,下面有一个写了
    for i, emp in enumerate(empiric.split(group[1])):
        emps = emp.split(" ")
        empirics = {"time": "", "office": "", "firm": "", "empiric": "", "trade": "", "Pnumber": "", "kind": "",
                    "workdesp": "", "section": ""}
        if i == 0:
            empirics["time"] = emps[0].split("软件")[0]
            empirics["office"] = "软件工程师"
        else:
            empirics["time"] = group[1] + "-" + emps[0].split("Android")[0]
            empirics["office"] = "Android工程师"
        empirics["section"] = emps[0].split("工程师")[1]
        empirics["firm"] = emps[1]
        empirics["empiric"] = emps[2].replace("[", "").replace("]", "")
        empirics["workdesp"] = emps[3].split("工作描述：")[1]
        empirics["Pnumber"] = re.findall("(\d{1,4}-\d{1,4}人)", emps[3])[0]
        empirics["trade"], empirics["kind"] = emps[3].split("工作描述：")[0].split(empirics["Pnumber"])
        resume["empiric"].append(empirics)
    project_group = re.findall("(\d{4}/\d-)", project_empiric)
    step = 0;
    while len(project_group) > step:
        empirics = {"time": "", "name": "", "firm": "", "workdesp": "", "trustdesp": "", }
        emps = ""
        # 防止下角标越界
        if step < len(project_group) - 1:
            emps = project_empiric.split(project_group[step])[1].split(project_group[step + 1])[0]
        else:
            emps = project_empiric.split(project_group[step])[1]
        if "至今" in emps:
            empirics["time"] = project_group[step] + "-至今"
            empirics["name"] = emps.replace("至今", "").split("所属公司")[0]
        else:
            empirics["time"] = project_group[step] + re.findall("(\d{4}/\d)", emps)[0]
            empirics["name"] = emps.replace(re.findall("(\d{4}/\d)", emps)[0], "").split("所属公司")[0]
        empirics["firm"] = emps.split("所属公司：")[1].split("项目描述：")[0]
        empirics["workdesp"] = emps.split("项目描述：")[1].split("责任描述：")[0]
        empirics["trustdesp"] = emps.split("责任描述：")[1]
        resume["project_empiric"].append(empirics)
        step += 1
    #for i, j in resume.items():
    #    print("{}:{}".format(i, j))
    return dictToHtml(resume)

